      <text id="22" justification="0" size="4" underlined="false">
        <text>login() calls PeopleBag method login()
setAdmin() sets view to admin
setFaculty() sets view to faculty
etc.
changeStudentInfo() takes info from admin
and sends it to model after calling:
 
modify(), which manipulates the info
e.g. getting rid of extra spaces, and 
whatever else is necessary to tidy it.</text>
